import React from "react";
import SimpleImageSlider from "react-simple-image-slider";

const Moments = () => {
    const images = [
        { url: "../../images/t.jpg" },
        { url: "../../images/2.jpg" },
        { url: "../../images/3.JPG" },
    ];
    return (
        <div className="container" id="moments">
            <h2>Моменты</h2>
            <SimpleImageSlider
                width={896}
                height={504}
                images={images}
                showNavs
            />
        </div>
    );
}

export default Moments;
